import { Card, CardContent, Typography } from "@mui/material";
import React from "react";
// Import the SVG as a component
import { ReactComponent as TelevisionIcon } from "../assets/images/television.svg";

export const CustomCard = (props) => {
  const { Info, ...other } = props;

  return (
    <>
      <Card sx={{  borderRadius:'1rem' , background: "linear-gradient(149deg, #192247 0%, #210e17 96.86%)"}}>
        <CardContent>
          <Typography fontWeight={500} color="white">Enjoy on your TV</Typography>
          <Typography color="white" fontWeight={400}>
            Watch on smart TVs, PlayStation, Xbox, Chromecast, Apple TV, Blu-ray
            players and more.
          </Typography>
        </CardContent>

          {/* Render the SVG as a React component */}
          <TelevisionIcon style={{ width: 150, height: 150 }} />

      </Card>
    </>
  );
};

export default CustomCard;
